import c from './Profile.module.css';
import React from 'react';
import MyPosts from './myPosts/MyPosts';

const Profile = (props) => {

    let myPostsData = [
        {id:1, title: "Пост 1", text: "Текст", likes: 12, dislikes: 3},
        {id:1, title: "Пост 2", text: "Текст", likes: 16, dislikes: 5},
        {id:1, title: "Пост 3", text: "Текст", likes: 21, dislikes: 8},
        {id:1, title: "Пост 4", text: "Текст", likes: 16, dislikes: 2},
    ]

    return(
        <div className={c.Profile}>
            <img src="https://trashbox.ru/ifiles/220798_004e6a_img_20140503_122504.jpg_min1/avatarki.-1.jpg" className={c.Avatar}/>
            <div className={c.Info}>
                <h4>Username</h4><hr/>
                <p>Любимый клуб</p>
                <p>Количество постов</p>
                <p>Рейтинг</p>
            </div>
            <div className={c.MyPosts}>
                <h3>Посты пользователя</h3>
                <button>Добавить пост</button><hr/>
                <MyPosts title={myPostsData[0].title} text={myPostsData[0].text} likes={myPostsData[0].likes} dislikes={myPostsData[0].dislikes}/>
                <MyPosts title={myPostsData[1].title} text={myPostsData[1].text} likes={myPostsData[1].likes} dislikes={myPostsData[1].dislikes}/>
                <MyPosts title={myPostsData[2].title} text={myPostsData[2].text} likes={myPostsData[2].likes} dislikes={myPostsData[2].dislikes}/>
                <MyPosts title={myPostsData[3].title} text={myPostsData[3].text} likes={myPostsData[3].likes} dislikes={myPostsData[3].dislikes}/>
            </div>
        </div>
    );
}

export default Profile;
